WorkflowProcessEvent.eventDescription:
function afterStateEntry(sequenceId){
	
	

	var numEmpresa = getValue("WKCompany");
	var numProcesso = getValue("WKNumProces");
	var numAtividade = sequenceId;
	var numThread = hAPI.getActualThread(numEmpresa, numProcesso, numAtividade);
	var colleagueId = getValue("WKUser");
	
	//log.warn("----------------------AFTER STATE ENTRY 2 update-------------------------------")
	//log.warn("----------------------numEmpresa: " + numEmpresa);
	//log.warn("----------------------numProcesso: " + numProcesso);
	//log.warn("----------------------numThread: " + numThread);
	//log.warn("----------------------numAtividade: " + numAtividade);
	//log.warn("----------------------colleagueId: " + colleagueId);
	
	var userList = new java.util.ArrayList();
	userList.add(colleagueId);
	
	
	if(numAtividade == 71){  //implementar plano e ação
		var data = new Date();
		
		var prazo = hAPI.getCardValue("data_retirada");
		var dt_planejada;
		
		if (prazo.indexOf("-") > 0){
			dt_planejada = new java.lang.String(prazo).split("-");
			//log.warn("----------------------DIA: " + dt_planejada[2]);
			//log.warn("----------------------MES: " + (dt_planejada[1] - 1));
			//log.warn("----------------------ANO: " + dt_planejada[0]);	
			//seta o dia, mês (Janeiro é 0) e ano
			data.setDate(dt_planejada[2]);
			data.setMonth(dt_planejada[1] - 1);
			data.setFullYear(dt_planejada[0]);
			//log.warn("----------------------DATA: " + data);
		} else{
			dt_planejada = new java.lang.String(prazo).split("/");
			//log.warn("----------------------DIA: " + dt_planejada[0]);
			//log.warn("----------------------MES: " + (dt_planejada[1] - 1));
			//log.warn("----------------------ANO: " + dt_planejada[2]);
			//seta o dia, mês (Janeiro é 0) e ano
			data.setDate(dt_planejada[0]);
			data.setMonth(dt_planejada[1] - 1);
			data.setFullYear(dt_planejada[2]);
			//log.warn("----------------------DATA: " + data);
		}
		
		hAPI.setDueDate(numProcesso, numThread, 'Pool:Role:tesouraria', data, 28800);
	}
	

}

function beforeStateEntry(sequenceId){

	var numEmpresa = getValue("WKCompany");
	var numProcesso = getValue("WKNumProces");
	var numAtividade = sequenceId;
	var numThread = hAPI.getActualThread(numEmpresa, numProcesso, numAtividade);
	var colleagueId = getValue("WKUser");
	
	//log.warn("----------------------BEFORE STATE ENTRY 2 update-------------------------------")
	//log.warn("----------------------numEmpresa: " + numEmpresa);
	//log.warn("----------------------numProcesso: " + numProcesso);
	//log.warn("----------------------numThread: " + numThread);
	//log.warn("----------------------numAtividade: " + numAtividade);
	//log.warn("----------------------colleagueId: " + colleagueId);
	
	if(numAtividade == 28){ 
		var userList = new java.util.ArrayList();
		userList.add(hAPI.getCardValue("matricula_emissor"));
		
		var hpForm = new java.util.HashMap();						
		
		hpForm.put("data_prazo", hAPI.getCardValue("dtprazoativ_retorno"));
		hpForm.put("origem_desp", "sol_viagem");
		hpForm.put("moeda", hAPI.getCardValue("moeda"));
		hpForm.put("vl_prestacao", hAPI.getCardValue("vl_fornec"));
		
		hpForm.put("matricula_resp", hAPI.getCardValue("matricula_emissor"));
		hpForm.put("nome_resp", hAPI.getCardValue("user_emissor"));
		
		hpForm.put("desc_emissao", "RDV iniciado automaticamente pela Solicitação de Viagem nr.: " + numProcesso);
		
		hpForm.put("cpf_cnpj", hAPI.getCardValue("cpf_cnpj"));
		hpForm.put("banco", hAPI.getCardValue("banco"));
		hpForm.put("agencia", hAPI.getCardValue("agencia"));
		hpForm.put("conta_cor", hAPI.getCardValue("conta_cor"));			
		
		var resposta = hAPI.startProcess("RDV", 5, userList, "Iniciado pela solicitação de viagem nr.: " + numProcesso, true, hpForm, false);
		hAPI.setCardValue("desc_entregue", hAPI.getCardValue("desc_entregue") + "\nIniciado processo de RDV nr.: " + resposta.get("iProcess"));
	}


	
	
	
}

function afterTaskCreate(colleagueId) {
    var atividade = getValue('WKCurrentState');
    
    if (atividade == 71) {
        // Recuperando a data informada no campo do formulário
        var dataStr = hAPI.getCardValue("data_retirada").split("/");
	    if (dataStr != undefined && dataStr != '') {
	    	
	    	var data = new Date();
	    	data.setDate(dataStr[0]);
			data.setMonth(dataStr[1] - 1);
			data.setFullYear(dataStr[2]);
	    
			var numEmpresa = getValue("WKCompany");
	        var numeroDaSolicitacao = getValue('WKNumProces');
	        var threadDaSolicitacao = hAPI.getActualThread(numEmpresa, numeroDaSolicitacao, atividade);
	        
	        // Altera o prazo de conclusão
	        hAPI.setDueDate(numeroDaSolicitacao, threadDaSolicitacao, colleagueId, data, 28800);
	    }
    }  
}
